import React from "react";
import {
  VictoryBar,
  VictoryChart,
  VictoryTheme,
  VictoryPolarAxis,
} from "victory";
const concepts = [
  { id: "ai_TJ9wFfK5", name: "portrait", value: 0.99354845, app_id: "main" },
  { id: "ai_SVshtN54", name: "one", value: 0.98571116, app_id: "main" },
  { id: "ai_dxSG2s86", name: "man", value: 0.9889341, app_id: "main" },
  { id: "ai_l8TKp2h5", name: "people", value: 0.9853919, app_id: "main" },
  { id: "ai_VPmHr5bm", name: "adult", value: 0.98204, app_id: "main" },
  { id: "ai_13NdwKqz", name: "festival", value: 0.9815703, app_id: "main" },
  { id: "ai_PzRPjgcp", name: "facial hair", value: 0.9788352, app_id: "main" },
  { id: "ai_86sS08Pw", name: "wear", value: 0.9622925, app_id: "main" },
  { id: "ai_S81BZrtF", name: "musician", value: 0.95367235, app_id: "main" },
  {
    id: "ai_GxSDhQ34",
    name: "facial expression",
    value: 0.9511193,
    app_id: "main",
  },
  { id: "ai_J5tkrb20", name: "eyewear", value: 0.9452471, app_id: "main" },
  { id: "ai_k76BrtPJ", name: "music", value: 0.9451725, app_id: "main" },
];
const Graph = (props) => {
  return (
    <VictoryChart
      polar
      theme={VictoryTheme.material}
      singleQuadrantDomainPadding={true}
      range={{ x: [0, 360], y: [0, 20] }}
      domain={{ y: [0.8, 1.02] }}
    >
      {concepts
        .reduce((acc, val) => {
          acc.push(val.name);
          return acc;
        }, [])
        .map((d, i) => {
          return (
            <VictoryPolarAxis
              dependentAxis
              key={i}
              label={d}
              labelPlacement="parallel"
              style={{ tickLabels: { fill: "none" } }}
              axisValue={d}
            />
          );
        })}
      <VictoryBar
        style={{ data: { fill: "tomato", width: 5 } }}
        data={concepts}
        x="name"
        y="value"
      />
    </VictoryChart>
  );
};
export default Graph;
